import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './components/app/';
import reportWebVitals from './reportWebVitals';

function WhoAmI(info) {
  return (
    <>
      <h1>My name is {info.name}, surname - {info.surname}</h1>
      <a href={info.link}>My profile</a>
    </>
  )
}

const All = () => {
  return (
    <>
    <WhoAmI name="Diyaz" surname="Samidinov" link="facebook.com" />
    <WhoAmI name="Max" surname="Soldier" link="facebook.com" />
    <WhoAmI name="Bilgar" surname="Ensh" link="facebook.com" />
    </>
  )
}
ReactDOM.render(
  <React.StrictMode>
      <All></All>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
